import React from 'react';

const Navbar = () => {
return (
 <nav>
   <div />
   <div>
   <img
   src="https://raw.githubusercontent.com/PokeAPI/media/master/logo/pokeapi_256.png"
   alt="pokeapi-logo"
   className="navbar-image"/>
   </div>
   <div>❤️</div>
 </nav>
 );
};

export default Navbar
